import React, { Component } from 'react'

class Navbar extends Component {
    render() {
        return (
            <nav className="navbar bg-primary">
                <i className="fab fa-github"></i>
                <h1> Navbar </h1>
            </nav>
        )
    }
}

export default Navbar
